(3, 1, 'Gedung Putra Solo RIAU', 'burung-3.jpg', '<p><cite>Gedung Putra Solo Rantau Parapat adalah gedung dari organisasi Yayasan Persatuan Persaudaraan Putra Solo yang menyediakan Gedung yang bisa digunakan untuk acara konvensional&nbsp;dan juga Lapangan olahraga yang dapat digunakan untuk bermain Badminton. </cite></p>\r\n\r\n<p><cite>FASILITAS : Terdapat ruangan kosong yang dapat dipergunakan sebagai tempat menyimpan segala kebutuhan anda dan juga gedung memfasilitasi kamar mandi yang dapat dipergunakan sebanyak 2 (dua) buah kamar mandi yang terletak&nbsp;dibagian belakang gedung dan juga area parkir yang aman.</cite></p>\r\n\r\n<p><cite>Resepsionis hubungi SUWARNO WA (0812-6831-823)&nbsp;&nbsp;</cite></p>\r\n', 'Jalan Perjuangan No.110, Bagan Silembah, Riau', 0, '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3988.520770916206!2d101.26298307417208!3d1.4612845612091907!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x31d3746ea14436b7%3A0xeabe23d377c8ad04!2sJl.%20Perjuangan%2C%20Rantau%20Bais%2C%20Kec.%20Tanah%20Putih%2C%20Kabupaten%20Rokan%20Hilir%2C%20Riau!5e0!3m2!1sid!2sid!4v1686112445594!5m2!1sid!2sid\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 600000, '082276343745', 'Y'),
(4, 1, 'Gedung Putra Solo PEMATANGSIANTAR', 'burung-4.jpg', '<p><cite>Gedung Putra Solo Rantau Parapat adalah gedung dari organisasi Yayasan Persatuan Persaudaraan Putra Solo yang menyediakan Gedung yang bisa digunakan untuk acara konvensional&nbsp;dan juga Lapangan olahraga yang dapat digunakan untuk bermain Badminton. </cite></p>\r\n\r\n<p><cite>FASILITAS : Terdapat ruangan kosong yang dapat dipergunakan sebagai tempat menyimpan segala kebutuhan anda dan juga gedung memfasilitasi kamar mandi yang dapat dipergunakan sebanyak 2 (dua) buah kamar mandi yang terletak&nbsp;dibagian belakang gedung dan juga area parkir yang aman.</cite></p>\r\n\r\n<p><cite>Resepsionis hubungi SUWARNO WA (0812-6213-113)</cite></p>\r\n', 'Jalan Masjid No. 27, Pematangsiantar', 255, '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3984.512053715296!2d99.0448098!3d2.95531480000001!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x303185a057e186bf%3A0x7fccb83df3ee0164!2sPUTRA%20SOLO%20SPORT!5e0!3m2!1sid!2sid!4v1686111973730!5m2!1sid!2sid\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 600000, NULL, 'Y'),
